script: |
  super -f text -I q2101.spq | sort > q2101.out

inputs:
  - name: q2101.spq
    data: |
      SELECT + 64 FROM tab0 (FORMAT parquet) WHERE NOT - col1 NOT BETWEEN + col2 * - col1 - - col1 + - - 56 AND - - 12;
  - name: tab0

outputs:
  - name: q2101.out
    data: |
      64
      64
      64
